import React, { Component } from 'react';
import './App.scss';
const props = {"home": {
    "instanceName": "HomePage_031219",
    "ciid": "16840624",
    "type": "home",
    "name": "HomeMultiSimple"}};
class App extends Component {
  render() {
    console.log(props);
    return (
      <div className="App" json={props}>
        <header className="App-header">
          <h2>Welcome to SEW JSON/HTML Tool</h2>
        </header>
        <ul>
        {props.json.map(item => {
          return (
            <li key={item.name}>
              <div {...item} />
            </li>
          );
        })}
      </ul>
      </div>
    );
  }
}

export default App;
